INSERT INTO `field_data_body` VALUES ('node','page',0,1,1,'und',0,'For the last 98 years Camp Adair has been inspiring and encouraging children, young adults and corporate groups to become strong New Zealanders. At YMCA Camp Adair we offer a wide variety of adventure based activities with programmes that are tailored to suit specific needs and goals. We encourage a ‘challenge by choice’ experience to our clients facilitated by our highly trained instructors. Our staff will design a programme that meets your objectives and your budget. Common programme goals include teaching and building confidence, facilitation of team building and improving group communication skills.','','plain_text'),('node','page',0,5,5,'und',0,'Our camps offer a wide range of activities to suit the needs of each group; all levels of fitness, physical ability and group size. The activities below are available at each Y-Outdoors facility as indicated. \r\n\r\nWe recommend your programme schedule should be based on allowing 1.5 to 2.5 hours for an activity. This gives the group time to learn the skills to be able to succeed and then enjoy the activity. Experience shows that the structured part of any day needs to be balanced by organised free time activities such as an hour or so of sports, swimming or games in the late afternoon.  ','','plain_text'),('node','page',0,6,6,'und',0,'Our camps offer a wide range of activities to suit the needs of each group; all levels of fitness, physical ability and group size. The activities below are available at each Y-Outdoors facility as indicated. \r\n\r\nWe recommend your programme schedule should be based on allowing 1.5 to 2.5 hours for an activity. This gives the group time to learn the skills to be able to succeed and then enjoy the activity. Experience shows that the structured part of any day needs to be balanced by organised free time activities such as an hour or so of sports, swimming or games in the late afternoon.  ','','plain_text'),('node','page',0,7,7,'und',0,'Situated on nearly 100 acres of farmland, native bush, open fields with the Wairoa River running through the camp, it is a rural retreat within easy access of Auckland city.\r\n\r\nCamp Adair has three fully self contained villages. We are able to sleep a total of 374 people. Each village has its own cooking, dining, sleeping (bunks), ablution, gas BBQ and camp fire areas. We supply mattresses on bunk beds, while guests are asked to provide their own cutlery, linen or sleeping bags, towels and pillows. A large campfire area located in a grove of Kahikateas is a wonderful venue for a campfire sing-along and concert. Use of this area is available at no charge. Please note that firewood itself is an additional charge but can be conveniently ordered and delivered to camp on request. Also available at Camp Adair is a recreation hall and our historic school house. Additional facilities and services include a rugby and soccer field, grass volleyball court, beach volleyball court, sports equipment with lots of open space, gas BBQ’s, broadband internet access, cellphone coverage for Vodafone and Telecom.\r\n\r\nServices include:\r\n\r\nqualified outdoor instruction\r\ncatering\r\nassistance with planning your outdoors experience\r\nteam building\r\npersonal development facility hire (e.g. weddings, family reunions, corporate training, christmas parties)\r\nFacilities include:\r\n\r\naccommodation\r\nablution blocks including hot showers\r\nmeeting rooms\r\nkitchen facilities (self catering options are available during selected times of the year only, contact your YMCA camp for details)\r\nimmediate access to some of the most spectular natural environments in New Zealand','','plain_text');
/*!40000 ALTER TABLE `field_data_body` ENABLE KEYS */;
UNLOCK TABLES;

