INSERT INTO `search_dataset` VALUES (1,'node',' camp adair for the last 98 years camp adair has been inspiring and encouraging children young adults and corporate groups to become strong new zealanders at ymca camp adair we offer a wide variety of adventure based activities with programmes that are tailored to suit specific needs and goals we encourage a challenge by choice experience to our clients facilitated by our highly trained instructors our staff will design a programme that meets your objectives and your budget common programme goals include teaching and building confidence facilitation of team building and improving group communication skills  ',0),(5,'node',' activities our camps offer a wide range of activities to suit the needs of each group all levels of fitness physical ability and group size the activities below are available at each youtdoors facility as indicated we recommend your programme schedule should be based on allowing 15 to 25 hours for an activity this gives the group time to learn the skills to be able to succeed and then enjoy the activity experience shows that the structured part of any day needs to be balanced by organised free time activities such as an hour or so of sports swimming or games in the late afternoon  ',0),(6,'node',' group bookings our camps offer a wide range of activities to suit the needs of each group all levels of fitness physical ability and group size the activities below are available at each youtdoors facility as indicated we recommend your programme schedule should be based on allowing 15 to 25 hours for an activity this gives the group time to learn the skills to be able to succeed and then enjoy the activity experience shows that the structured part of any day needs to be balanced by organised free time activities such as an hour or so of sports swimming or games in the late afternoon  ',0),(7,'node',' services and facilities situated on nearly 100 acres of farmland native bush open fields with the wairoa river running through the camp it is a rural retreat within easy access of auckland city camp adair has three fully self contained villages we are able to sleep a total of 374 people each village has its own cooking dining sleeping bunks ablution gas bbq and camp fire areas we supply mattresses on bunk beds while guests are asked to provide their own cutlery linen or sleeping bags towels and pillows a large campfire area located in a grove of kahikateas is a wonderful venue for a campfire singalong and concert use of this area is available at no charge please note that firewood itself is an additional charge but can be conveniently ordered and delivered to camp on request also available at camp adair is a recreation hall and our historic school house additional facilities and services include a rugby and soccer field grass volleyball court beach volleyball court sports equipment with lots of open space gas bbq s broadband internet access cellphone coverage for vodafone and telecom services include qualified outdoor instruction catering assistance with planning your outdoors experience team building personal development facility hire eg weddings family reunions corporate training christmas parties facilities include accommodation ablution blocks including hot showers meeting rooms kitchen facilities self catering options are available during selected times of the year only contact your ymca camp for details immediate access to some of the most spectular natural environments in new zealand  ',0),(8,'node',' make a booking ',0);
/*!40000 ALTER TABLE `search_dataset` ENABLE KEYS */;
UNLOCK TABLES;

